function Contact() {

  const containerStyle = {
    display: "flex",
    flexDirection: "column",
    gap: "12px",
    width: "280px",
    margin: "40px auto",
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
  };

  const linkStyle = {
    display: "flex",
    alignItems: "center",
    gap: "10px",
    padding: "8px 12px",
    borderRadius: "8px",
    textDecoration: "none",
    color: "#333",
    backgroundColor: "#f0f0f0",
    transition: "all 0.2s ease",
    fontWeight: "500",
  };

  const iconStyle = {
    width: "20px",
    height: "20px",
    display: "inline-block",
    backgroundColor: "#4f46e5",
    borderRadius: "50%",
    textAlign: "center",
    lineHeight: "20px",
    color: "#fff",
    fontSize: "12px",
  };

  const hoverEffect = (e) => {
    e.currentTarget.style.backgroundColor = "#4f46e5";
    e.currentTarget.style.color = "#fff";
    e.currentTarget.style.transform = "translateX(5px)";
  };

  const leaveEffect = (e) => {
    e.currentTarget.style.backgroundColor = "#f0f0f0";
    e.currentTarget.style.color = "#333";
    e.currentTarget.style.transform = "translateX(0)";
  };





  const barStyle = {
    position: "fixed",
    bottom: "20px",
    right: "20px",
    display: "flex",
    gap: "12px",
    backgroundColor: "#fff",
    padding: "10px 14px",
    borderRadius: "50px",
    boxShadow: "0 6px 15px rgba(0,0,0,0.2)",
    zIndex: 999,
  };

  const iconContainer = {
    position: "relative",
    width: "44px",
    height: "44px",
    borderRadius: "50%",
    backgroundColor: "#4f46e5",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    color: "#fff",
    fontSize: "18px",
    cursor: "pointer",
    transition: "transform 0.2s, background-color 0.2s",
  };

  const tooltipStyle = {
    position: "absolute",
    bottom: "50px",
    left: "50%",
    transform: "translateX(-50%)",
    backgroundColor: "#333",
    color: "#fff",
    padding: "6px 10px",
    borderRadius: "6px",
    fontSize: "12px",
    whiteSpace: "nowrap",
    opacity: 0,
    pointerEvents: "none",
    transition: "opacity 0.2s",
  };

  const showTooltip = (e) => {
    e.currentTarget.querySelector(".tooltip").style.opacity = 1;
    e.currentTarget.style.transform = "scale(1.2)";
  };

  const hideTooltip = (e) => {
    e.currentTarget.querySelector(".tooltip").style.opacity = 0;
    e.currentTarget.style.transform = "scale(1)";
  };

  const contacts = [
    {
      icon: "W",
      href: "https://wa.me/34644048205",
      tooltip: "+34 644 048 205",
      target: "_blank",
    },
    {
      icon: "E",
      href: "mailto:veronicasanchezjusticia2@gmail.com",
      tooltip: "veronicasanchezjusticia2@gmail.com",
      target: "_self",
    },
    {
      icon: "L",
      href: "https://www.linkedin.com/in/ver%C3%B3nica-s%C3%A1nchez-justicia-825a7421a/",
      tooltip: "LinkedIn",
      target: "_blank",
    },
    {
      icon: "P",
      href: "https://veronicasj.github.io/Portfolio/",
      tooltip: "Portfolio",
      target: "_blank",
    },
    {
      icon: "G",
      href: "https://github.com/VeronicaSj",
      tooltip: "GitHub",
      target: "_blank",
    },
  ];




  
  
    return (
        <section id="contact">
          <h2>Contact</h2>
          <p>You can contact me through the following means:</p>

          <div>
            
            {/*whatsapp*/}
            <div>
              <i></i>
              <a href="https://wa.me/34644048205" 
                  target="_blank">
                  +34 644 048 205
              </a>
            </div>

            {/*Email*/}
            <div>
              <i></i>
              <a href="mailto:veronicasanchezjusticia2@gmail.com" >
                veronicasanchezjusticia2@gmail.com
              </a>
            </div>

            {/*LinkedIn*/}
            <div>
              <i></i>
              <a href="https://www.linkedin.com/in/ver%C3%B3nica-s%C3%A1nchez-justicia-825a7421a/" 
                  target="_blank">
                  LinkedIn
              </a>
            </div>

            
            {/* <!-- Portfolio --> */}
            <div>
              <i></i>
              <a href="https://veronicasj.github.io/Portfolio/" 
                  target="_blank">
                  Portfolio
              </a>
            </div>

            
            {/* GitHub */}
            <div>
              <i></i>
              <a href="https://github.com/VeronicaSj" 
                  target="_blank">
                  GitHub
              </a>
            </div>
          </div>

          <div style={containerStyle}>
      <a
        href="https://wa.me/34644048205"
        target="_blank"
        rel="noreferrer"
        style={linkStyle}
        onMouseEnter={hoverEffect}
        onMouseLeave={leaveEffect}
      >
        <span style={iconStyle}>W</span> +34 644 048 205
      </a>

      <a
        href="mailto:veronicasanchezjusticia2@gmail.com"
        style={linkStyle}
        onMouseEnter={hoverEffect}
        onMouseLeave={leaveEffect}
      >
        <span style={iconStyle}>E</span> veronicasanchezjusticia2@gmail.com
      </a>

      <a
        href="https://www.linkedin.com/in/ver%C3%B3nica-s%C3%A1nchez-justicia-825a7421a/"
        target="_blank"
        rel="noreferrer"
        style={linkStyle}
        onMouseEnter={hoverEffect}
        onMouseLeave={leaveEffect}
      >
        <span style={iconStyle}>L</span> LinkedIn
      </a>

      <a
        href="https://veronicasj.github.io/Portfolio/"
        target="_blank"
        rel="noreferrer"
        style={linkStyle}
        onMouseEnter={hoverEffect}
        onMouseLeave={leaveEffect}
      >
        <span style={iconStyle}>P</span> Portfolio
      </a>

      <a
        href="https://github.com/VeronicaSj"
        target="_blank"
        rel="noreferrer"
        style={linkStyle}
        onMouseEnter={hoverEffect}
        onMouseLeave={leaveEffect}
      >
        <span style={iconStyle}>G</span> GitHub
      </a>
    </div>


<div style={barStyle}>
      {contacts.map((contact, index) => (
        <a
          key={index}
          href={contact.href}
          target={contact.target}
          rel="noreferrer"
          style={iconContainer}
          onMouseEnter={showTooltip}
          onMouseLeave={hideTooltip}
        >
          {contact.icon}
          <span className="tooltip" style={tooltipStyle}>
            {contact.tooltip}
          </span>
        </a>
      ))}
    </div>
        </section>
    );
}

export default Contact;
